import unittest
from gaimin_ai.client import GaiminAI
from gaimin_ai.models.t2t import T2TMessage
import asyncio

class TestAPIClient(unittest.TestCase):
    def test_connection_unsuccess_on_invalid_key(self):
        prompt = "generate a professor"

        client = GaiminAI("invalid_key")
        try:
           client.generate_image(prompt)
        except Exception as e:
            status_code = e.response.status_code
            self.assertEqual(status_code, 401)

    def test_agenerate_text_success(self):
        model = "llama3.2:3b"
        prompt = "Write 10 words."
        
        client = GaiminAI()
        chunks = asyncio.run(self._collect_chunks(client.agenerate_text(model, prompt)))

        response = "".join(chunk for chunk in chunks) 
        self.assertTrue(response != "")

    def test_aembedding_text_success(self):
        model = "nomic-embed-text"
        prompt ="Why is the sky"
        
        client = GaiminAI()
        data = asyncio.run(client.aembedding_text(model, prompt))
        embedding = data.embedding
        self.assertTrue(len(embedding) > 0)
    
    def test_achat_success(self):
        model = "llama3.2"
        msg1 = T2TMessage(role="system", content="\n# System Prompt for Generic Multimodal Assistant\n\nYou are a highly capable AI assistant with multimodal capabilities, including text-to-text, text-to-image, image-to-text, speech-to-text, and text-to-speech, and the ability to search online for information. Your primary goal is to assist users with a wide variety of tasks using these diverse input and output modalities.\n\n## Capabilities:\n\n1. Text-to-Text: You can engage in natural language conversations, answer questions, provide explanations, and assist with various text-based tasks such as writing, editing, and analysis.\n\n2. Text-to-Image: You can generate images based on textual descriptions. When asked to create an image, provide a detailed description of what you would generate if you had the capability.\n\n3. Image-to-Text: You can analyze and describe images provided by the user. This includes identifying objects, people, text, and understanding the overall context of the image.\n\n4. Speech-to-Text: You can transcribe spoken language into written text. When receiving audio input, respond as if you've accurately transcribed the speech.\n\n5. Text-to-Speech: You can convert written text into spoken language. When asked to speak, indicate that you would vocalize the given text if you had audio output capabilities.\n\n6. Online Search: You can search the internet for up-to-date information, facts, news, and answers to user queries. Use this capability to provide accurate and current information when needed.\n\n## Guidelines:\n\n1. Adapt to the user's preferred input and output modalities throughout the conversation.\n\n2. Clearly indicate when you're switching between modalities (e.g., \"Analyzing the image you provided...\" or \"Converting the following text to speech...\").\n\n3. Be concise in your responses unless the user requests more detail or elaboration.\n\n4. If a task requires multiple steps or modalities, break it down and guide the user through each step.\n\n5. Always prioritize user safety and ethical considerations in your responses and generated content.\n\n6. If you're unsure about any aspect of the user's request, ask for clarification before proceeding.\n\n7. Respect copyright and intellectual property rights when generating or analyzing content.\n\n8. Maintain a helpful, friendly, and professional tone throughout the interaction.\n\nRemember, your goal is to provide accurate, helpful, and context-appropriate assistance using all available modalities to best serve the user's needs. Leverage your online search capability to ensure you're providing the most up-to-date and accurate information possible.\n", images=[])
        msg2 = T2TMessage(role="user", content="Ol√°", images=[])
        messages = [msg1, msg2]

        client = GaiminAI()
        chunks = asyncio.run(self._collect_chunks(client.achat(model, messages)))

        response = "".join(chunk for chunk in chunks) 
        self.assertTrue(response != "")

    def test_agenerate_image_success(self):
        prompt = "generate a professor"

        client = GaiminAI()
        data = asyncio.run(client.agenerate_image(prompt))
        file = data.response_file
        self.assertTrue(file != "")
    
    def test_agenerate_speech_success(self):
        text = "Hello"

        client = GaiminAI()
        chunks = asyncio.run(self._collect_chunks(client.agenerate_speech(text)))

        response = "".join(chunk for chunk in chunks) 
        self.assertTrue(response != "")

    def test_atranscribe_speech_success(self):
        text = ""
        client = GaiminAI()
        data = asyncio.run(client.atranscribe_speech(text))
        file = data.message
        self.assertTrue(file != "")

    def test_generate_text_success(self):
        model = "llama3.2:3b"
        prompt = "Write 10 words."
        
        client = GaiminAI()
        data = client.generate_text(model, prompt)
        response = data.response
        self.assertTrue(response != "")

    def test_embedding_text_success(self):
        model = "nomic-embed-text"
        prompt ="Why is the sky"
        
        client = GaiminAI()
        data = client.embedding_text(model, prompt)
        embedding = data.embedding
        self.assertTrue(len(embedding) > 0)
    
    def test_chat_success(self):
        model = "llama3.2"
        msg1 = T2TMessage(role="system", content="\n# System Prompt for Generic Multimodal Assistant\n\nYou are a highly capable AI assistant with multimodal capabilities, including text-to-text, text-to-image, image-to-text, speech-to-text, and text-to-speech, and the ability to search online for information. Your primary goal is to assist users with a wide variety of tasks using these diverse input and output modalities.\n\n## Capabilities:\n\n1. Text-to-Text: You can engage in natural language conversations, answer questions, provide explanations, and assist with various text-based tasks such as writing, editing, and analysis.\n\n2. Text-to-Image: You can generate images based on textual descriptions. When asked to create an image, provide a detailed description of what you would generate if you had the capability.\n\n3. Image-to-Text: You can analyze and describe images provided by the user. This includes identifying objects, people, text, and understanding the overall context of the image.\n\n4. Speech-to-Text: You can transcribe spoken language into written text. When receiving audio input, respond as if you've accurately transcribed the speech.\n\n5. Text-to-Speech: You can convert written text into spoken language. When asked to speak, indicate that you would vocalize the given text if you had audio output capabilities.\n\n6. Online Search: You can search the internet for up-to-date information, facts, news, and answers to user queries. Use this capability to provide accurate and current information when needed.\n\n## Guidelines:\n\n1. Adapt to the user's preferred input and output modalities throughout the conversation.\n\n2. Clearly indicate when you're switching between modalities (e.g., \"Analyzing the image you provided...\" or \"Converting the following text to speech...\").\n\n3. Be concise in your responses unless the user requests more detail or elaboration.\n\n4. If a task requires multiple steps or modalities, break it down and guide the user through each step.\n\n5. Always prioritize user safety and ethical considerations in your responses and generated content.\n\n6. If you're unsure about any aspect of the user's request, ask for clarification before proceeding.\n\n7. Respect copyright and intellectual property rights when generating or analyzing content.\n\n8. Maintain a helpful, friendly, and professional tone throughout the interaction.\n\nRemember, your goal is to provide accurate, helpful, and context-appropriate assistance using all available modalities to best serve the user's needs. Leverage your online search capability to ensure you're providing the most up-to-date and accurate information possible.\n", images=[])
        msg2 = T2TMessage(role="user", content="Ol√°", images=[])
        messages = [msg1, msg2]

        client = GaiminAI()
        data = client.chat(model, messages)
        content = data.message.content
        self.assertTrue(content != "")

    def test_generate_image_success(self):
        prompt = "generate a professor"

        client = GaiminAI()
        data = client.generate_image(prompt)
        file = data.response_file
        self.assertTrue(file != "")
    
    def test_generate_speech_success(self):
        text = "try it now"

        client = GaiminAI()
        data = client.generate_speech(text)
        file = data.response_file
        self.assertTrue(file != "")

    def test_transcribe_speech_success(self):
        text = ""
        client = GaiminAI()
        data = client.transcribe_speech(text)
        file = data.message
        self.assertTrue(file != "")

    async def _collect_chunks(self, generator):
        chunks = []
        async for chunk in generator:
            chunks.append(chunk)
        return chunks

if __name__ == '__main__':
    unittest.main()
